import React from "react";
import "../style.css"
import { 
    MDBCard,
    MDBCardBody,
    MDBCardHeader,
    MDBRow,
    MDBCol
 } from "mdb-react-ui-kit";
 import { ProfileCard } from "./card";




export function TableSection(props) {

    const {tableTitle} = props

    const  dataForDream =  [<ProfileCard />,<ProfileCard />,<ProfileCard />]
    const dataForBest = [<ProfileCard />,<ProfileCard />,<ProfileCard />]

    return (
        <MDBCard className="table-section">
            <MDBCardHeader className="tableTitle" >
                {tableTitle}
            </MDBCardHeader>
            <MDBCardBody>
                <MDBRow className="tableSection-body h-60">
                    <MDBCol>
                        {
                            dataForBest.map(number => {
                                return(
                                    <div>
                                        {number}
                                    </div>
                                )
                            })
                        }                     
                    </MDBCol>
                </MDBRow>
            </MDBCardBody>
        </MDBCard>
    )



}
